import React from 'react';
import styled from 'styled-components';


const TotBalanceContainer = styled.div`
              display: flex;
                flex-direction: row;
                align-items: center;
                background-color: #000;
                padding: 15px;
                border-radius: 4px;

`;

const TotBalanceTitle = styled.div`
                display: flex;
                align-items: center;
                font-weight: 700;
                margin-right: 10px;
                color: #fff;
`;

const TotBalanceAmount = styled.div`
                display: flex;
                        align-items: center;
                        color: #fff;
`;


const TotBalance = (props) => {
    return (  
    <TotBalanceContainer>
    <TotBalanceTitle>Tot Balance </TotBalanceTitle>
    <TotBalanceAmount>$19,120,300.32</TotBalanceAmount>
    <span class="OneDayChange" href="#">+$1.48 24h</span>
    </TotBalanceContainer>
        );
  }

  export default TotBalance;
